export const _getAvailableRooms = () => {
    return fetch("http://localhost:3001/games", {
      method: "POST",
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json"
      }
    })
      .then(res => res.json())
      .then(resultingJSON => {
        console.log(resultingJSON);
      });
  };
